import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

const DataBase = (props) =>{
  let usersData = [
    { id: 1, name: 'John' },
    { id: 2, name: 'Jesus' },
    { id: 3, name: 'Jacob' },
    { id: 4, name: 'Jessica' },
    { id: 5, name: 'Jane' },
  ];
  let messageData = [
    { id: 1, message: 'Huylow' },
    { id: 2, message: 'Я хожу по воде' }, 
    { id: 3, message: 'Жакоб или Якоб?' },
    { id: 4, message: 'Альба?' },
    { id: 5, message: 'Fuck' },
  ];
  let postsData = [
  { id: 1, message: 'Hi pidr', like: 15, },
  { id: 2, message: 'My first post(second)',like: 25 },
  { id: 3, message: 'Pis',like: 12 },
  { id: 4, message: 'os',like: 999 },
  ]
  }
ReactDOM.render(
  <React.StrictMode>
    <App usersData={usersData} messageData={messageData} postsData={postsData}/>
  </React.StrictMode>,
  document.getElementById('root')
);



// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
export default DataBase;
